import React from "react";

export const Button = ({onClick, size, text}) =>{
    const sizeClases = {
        lg: "btn-Big",
        sm: "btn-Small"
    }
    return(
        <div className={`Button ${sizeClases[size]}`}>{text}</div>
    )
}
